import React from 'react'

function Search() {
  return (
	<div className='Search'>
		<input type="text" placeholder='Kinolarni qidirish'/>
		<button>Barcha kinolar</button>
		<button>Mashhur kinolar</button>
		<button>Eng ko</button>
	</div>
  )
}

export default Search
